import ReactDOM from 'react-dom';
import Header from  './components/common/header';
import './index.css';
import List from './components/list/list'
import Loading from './components/common';




 const App = () => {
    return <div>
                <Header/>
                <Loading/>
               <List/>
         </div>
 };







 ReactDOM.render(<App/>, document.getElementById('root'))
